
let db;
initSqlJs({ locateFile: file => `sql-wasm.wasm` }).then(SQL => {
    const base64String = "";
    const binaryString = atob(base64String);
    const byteArray = new Uint8Array(binaryString.length);
    for (let i = 0; i < binaryString.length; i++) {
        byteArray[i] = binaryString.charCodeAt(i);
    }
    db = new SQL.Database(byteArray);
    document.getElementById("output").innerHTML = "<p>🔍 Database loaded. Start querying!</p>";
});

function executeSQL() {
    const sql = document.getElementById("sql").value;
    let output = "";
    try {
        const results = db.exec(sql);
        if (results.length === 0) {
            output = "<p>No results.</p>";
        } else {
            results.forEach(result => {
                output += "<table><thead><tr>";
                result.columns.forEach(col => {
                    output += `<th>${col}</th>`;
                });
                output += "</tr></thead><tbody>";
                result.values.forEach(row => {
                    output += "<tr>";
                    row.forEach(cell => {
                        output += `<td>${cell}</td>`;
                    });
                    output += "</tr>";
                });
                output += "</tbody></table>";
            });
        }
    } catch (err) {
        output = `<p style='color:red;'>❌ Error: ${err.message}</p>`;
    }
    document.getElementById("output").innerHTML = output;
}
